import React from "react";
import PersonComponent from "./Person/PersonComponent";

const Persons = () => <div>aeks</div>;
this.props.personsName.map((person, index) => {
  return (
    <PersonComponent
      info={person}
      click={() => this.props.clicked(index)}
      key={person.id}
    />
  );
});

export default Persons;
